      <img class="materialboxed" src="https://i.cbc.ca/1.5170035.1560210566!/fileImage/httpImage/image.jpg_gen/derivatives/16x9_780/hospital-doctor.jpg" alt="1"/>
      <p className="legend">Find Doctors Near You</p>
    </div>
    <div>
      <img class='pharmacy'src="https://media.gettyimages.com/photos/happy-pharmacist-working-at-a-drugstore-picture-id610573018" alt="2" />
